INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (1,4,13,9,'Positives:-\nDid the requirement\nGood knowledge on SAIL design\nImprovements:-\nNeed to follow all the process model,datatype,SAIL best practices\nNeed to do the requirement with error less\nShould follow reusable rules',NULL,'2016-11-10 07:35:35',7,'',NULL,'','2016-11-10 07:35:35','anjannat');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (2,5,13,15,'positives:-\n  --Done the requirement some part\nImprovememnts:-\nNo best practices in Processmodeling,\nNo re usebility rules in the SAIL for example present and Perminent addresses are not reused\nthere are few issues while running the action\nFew requirements are not implemented',NULL,'2016-11-10 09:50:01',7,'',NULL,'','2016-11-10 09:50:01','anjannat');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (3,24,14,9,'Requirement achieved in positive testing. Process failed in rigorous testing.\n\nInterface:\n-It would be better to have blood group as a drop down.\n-Form instruction was incorrect style.\n-Joining date has incorrect validation message.\n-Change the Validation message for First, Last Name\n-Correct the confirmation Details title\n\nProcess Model:\n-Don\'t have activity chaining for UI task after action triggered.\n-Configure Process display Name Dynamically\n-UI task didn\'t have exception\n-No Cancel Flow\n-Joining date not saving if default value populated, even date changing shows only today.\n-Use task dynamic display name\n-Don\'t have Lanes, Annotations, Node Descriptions Alerts and Data management.\n-Handle Reassign options.\n\nImprovements:\n-This Process Model triggered from Actions, So you can use process start form instead UI task.\n-Interface looking good, But i feel better to keep personal details in one column and org details in second column.\n-Rather than querying again to show employee details you can use WTDS saved values output.',NULL,'2016-11-10 10:57:23',7,'',NULL,'','2016-11-10 10:57:23','venusaikumarc');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (4,52,13,9,'Positives:--\n---Done some part of requirement\n---UI is okay\n---Filters and navigation part are working fine\n---Has written DB view which is good\n\nImprovements:-\nNo best practices for process modeling like managing lanes, alert setting,archival settings etc...,\nStill some part of the requirements are missed like showing all the employee details for the first time.\nPerformance should be increased in the code like using too many with() functions in single interface and calling query rules from there.\nNeed to improve some part of UI like showing temporary and permanent address in the same cell.',NULL,'2016-11-10 13:12:21',7,'',NULL,'','2016-11-10 13:12:21','anjannat');
