INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (25,6,10,10,'CDT Best practices\n\"1. No JPA Annotation used in All Cdts\n2. Field name and table name are not proper\n3. Name space of CDT has Appin in it\n4. CDT Description has not used in effective way.\"\n\n\nProcess model best practices\n\"1. Alert and Data management setting not configured.\n2. No description and name for process model on process designer.\n\nProcess model name: RAM_IAL_Manage Address\"\n\n\nInterface Rule\n\"1. Code readablity is not good\n2. Hard to maintian such rules\n3. No from title\n4. Button names are not well labeled\nRule name:RAM_IAL_employeeAddress\"\n\n\nRequirement understanding\n\"1. No option to uddate address\n2. Scrren only searches the address\n3. 80 % of requrement not implemented.\"\n',NULL,'2016-12-01 11:57:37',7,'',NULL,'','2016-12-01 11:57:37','ajinkyab');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (26,10,10,7,'1. No data management and alert setting configured for process model \'RAM_IAL_INF_3_Column Browser\'.\n2. Process model description and process model should be written on process model as well.\n3. Run time process name should be there.\n4.  Form title is not available\n5. Naming convention are followed for rule name.\n6. SAIL Expression looks good.\n3. Requirement understanding was clear',NULL,'2016-12-01 13:00:13',7,'',NULL,'','2016-12-01 13:00:13','ajinkyab');
