INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (29,44,17,12,'Positive Points : \n•	Configuring lanes in process model.\n•	Setting security of process models, rules and action.\n•	Main form has section interface as separate rules.\nNegative Points : \n•	Default Value for Joining Date is missed.\n•	Gender should be mandatory.\n•	User name format is not correct\n•	Read only dropdowns in second Interface is not required, should be a text field. \n•	Choice label and choice values comes from constant and database which is not consistent.\nSuggestion :\n•	Process display name should have unique id for easy maintenance and debugging.\n•	Read only fields should always be text field component.\n•	It is good to have some description as a process model annotation and node\'s description.\n•	Interface : try to get data from database rather than constants using local variables.\n',NULL,'2016-12-14 10:27:38',7,'',NULL,'','2016-12-14 10:27:38','sonalk');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (30,59,14,5,'Deployed patch Successfully. Need to get more info on hierarchy browse component, hot it is better than cascading drop-down, differences b/w cascade drop-down and  Column browser. better to have a report to acess this from tempo',NULL,'2016-12-15 14:23:12',7,'',NULL,'','2016-12-15 14:23:12','venusaikumarc');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (31,48,10,12,'1. No data management and alert setting configured for process model \'RAM_IAL_INF_3_Column Browser\'.\n2. Process model description and process model should be written on process model as well.\n3. Run time process name should be there.\n4.  Form title is not available\n5. Naming convention are followed for rule name.\n6. SAIL Expression looks good.\n7. Requirement understanding was clear\n8. All data from database has been loaded in in SAIL form for reporting. Not a best practice',NULL,'2016-12-01 13:15:04',7,'',NULL,'','2016-12-01 13:15:04','ajinkyab');
