INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (37,53,10,4,'1. For displaying employee details no DB query has has been used. Display form directly shows the data from rule input which common from process , Hence core purpose of question not solve\n2. Father and mother details are visible on display form\n2. Readability of SAIL form is good.\n3. Common issues with process modelling .\n4. SAIL form has reusable\n',NULL,'2016-12-02 11:10:23',7,'',NULL,'','2016-12-02 11:10:23','ajinkyab');
