INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (40,14,1,10,'Use Constant for Data store entity\nConstants must always be CAPS - Other syntactical namings\nAlerts and Data management, Security\nSwimlanes with specific roles of Administrator and User\nTry to avoid unnecessary local variables and its initialisation\nNo calling query rules twice for same work use load variables\nEmail validation not done\nUse constants for placeholder labels\nWrite test cases always - minimum 2 one for null other for positive scenario',NULL,'2016-12-20 13:10:03',7,'',NULL,'','2016-12-20 13:10:03','sagarlodha');
