INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (44,80,17,20,'•	What was good ?\n- Implemented the nested CDT\'s as expected.\n- Implemented most of the business rules.\n- Use of generic interfaces.\n- Use of swim lanes.\n- Implemented feedback from the first question. \n\n•	What was wrong ?\n- Appian Process ID as unique Id in process instance was implemented, which is good but only in scenarios where it is being saved in database \n   else we can use Employee ID as it will be easy to find the debug instance based on Primary ID.\n- Read only form should not have radio button and checkbox.\n- A query rule placed in expression rule folder.\n- No default test cases used in rules.\n\n•	What could be improved ?\n- Using relevant data as unique reference.\n- Read only Interfaces should have text fields.\n- Use default test cases for rules. \n\n',NULL,'2016-12-27 01:30:04',7,'',NULL,'','2016-12-27 01:30:04','sonalk');
