INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (55,11,2,15,'Follow consistent naming convention for expression rules, constants, interfaces, and query rules. Process models don\'t have alert setting configured. Connectors don\'t have labels on them. Avoid hard-coding, and make use of index function and avoid using dot operator.',NULL,'2017-01-18 20:27:43',7,'',NULL,'','2017-01-18 20:27:43','amitkumarl');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (56,3,1,10,'Comments/description/annotaition in process model are must\nName od inputs task must giv e some info\nSmart services must be 90% in system lane\nAlerts not configured\nSecurity not set - not work for basic user\nFor interface keep it simple as mush as possible\nReuse of labels in constants which can be reused\nValidate email is not working as expected\nNo test case written\nUnnecessary objects must be removed from object\n\nSuggestions :\n1) Audit fileds to be captured\n2) Study optimisticlocking and how to do it in Appian - @Version\n3) Study Activity chaining\n4) Difference between Query rule and query entity',NULL,'2017-01-19 09:08:55',7,'',NULL,'','2017-01-19 09:08:55','sagarlodha');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (57,9,1,6,'Do not use with unless it is required\nUse query entities rather than Query rules',NULL,'2017-01-20 11:00:17',7,'',NULL,'','2017-01-20 11:00:17','sagarlodha');
