INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (59,12,1,2,'Copied from SAIL recipes and modified comments are still from recipe - try to understand the concept\nQuery entities in place of query rules\nCan we make the rule dynamic\nLearn opther browser fields too\nSee if we can do multiple selection',NULL,'2017-01-23 10:48:44',7,'',NULL,'','2017-01-23 10:48:44','sagarlodha');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (60,17,1,8,'Swimlanes no added\nSecurity not set\nAlerts not set\nComments/description/annotaition in process model are must\nCount,length,len difference\nuse index function as much as possible\nHow will you create logic for resting employee generation id every year with year in it.\nQuery rule is called twice for department. Fetch it once and reuse it\nFor interface keep it simple as mush as possible\nReuse of labels in constants which can be reused\nValidate email is not working as expected\nNo test case written\nRead only section must not have required field marks\nEmployeee id is not generated properly\n\nSuggestions - \n1) Set security\n2) data management \n3) Activity chaining\n4) Different ways to start process',NULL,'2017-01-23 12:02:39',7,'',NULL,'','2017-01-23 12:02:39','sagarlodha');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (61,16,1,10,'1) Unnecessary fileds are not required. Come up with logic which will send only relevant data and not all like ids etc.\n2) It has extra strings which are not needed to be generated\n3) Opposite conversion from xml to cdt or json to cdt\n\nRead JSON and XML basics\nAlways go around thetopic to improve knowledge',NULL,'2017-01-23 12:32:07',7,'',NULL,'','2017-01-23 12:32:07','sagarlodha');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (62,15,1,15,'Questions : - \n1) What is activity chaining? What is its limit and how can we configure it? What is downsize of using activity chaining on more than limit nodes or limit time? What is synchronising variables over the flow?\n2) What is data management? What is archiving process? Is process available for reporting or where does process indtance go? How can we unarchive a process? Scenario -  process gets cancelled(failed at any node) and its data management policy is set to Delete in 2 days. How will support work on this kind of scenarios?\n3) Difference between qury rule and qury entity? How to create on the fly object which can be used for displaying?\n4) Different ways to start process? Which way to start process will share load on engines?\n5) Basic groups needs to be created - Security at application?  Security at process model - DIFFERNT LEVELS?\n6) Reason behind not using nested cdts? What is pro and cons of saving nested cdt in db? What are pros and cons of using nested cdts while fetching?\n\n\nFeedback - \nComments/description/annotaition in process model are must\nSmart services must be 90% in system lane\nAlerts not configured\nSecurity not set - not work for basic user\nNo test case written\nReuse of labels in constants which can be reused\nSolution did not have interface for working\nTry to keep it organised.',NULL,'2017-01-23 13:17:44',7,'',NULL,'','2017-01-23 13:17:44','sagarlodha');
