INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (69,365,10,5,'1. Make proper use of action name and instructions\n2. Channing is missing for the first form\n3. Make proper use of form title\n4. Put changing between add employee form and display employee form\n5. The application should be runnable from tempo.\n6. All the fields on display form should be read-only\n7. separate the word in table in with separator e.g vasuemployee should have been vasu_employee\n8. Read about JPA Annotation\n9. use JPA annotation for naming column in table\n10. configure the data management, alert and security setting\n11. Read about data management settings in details\n12. use camel case for process variables naming conventions\n13. wherever possible use documentation in SAIL form',NULL,'2017-09-22 04:28:16',7,'',NULL,'','2017-09-22 04:28:16','ajinkyab');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (70,358,10,5,'Application was working as mentioned in problem statement\nNaming convention followed\nAverage Database knowledge\nNaming conventions are not consistent\nDatabase table name should have seperator in word e.g snemployeedetails should have been sn_employee_details\nIn XSD All column should have colummn name JPA annotation\nNo data managment setting configured in process model\nNo Alert setting configured in process model\nNo Security configured in process model\nProcess variable naming should be consistent\nprovide code documentation in process model and SAIL interface itself wherever required',NULL,'2017-09-19 11:55:53',7,'',NULL,'','2017-09-19 11:55:53','ajinkyab');
INSERT INTO `IAL_Question_Evaluation` (`id`,`questionSolutionId`,`evaluatorId`,`marksGiven`,`feedback`,`evaluationStartDate`,`evaluationEndDate`,`questionEvaluationStatusId`,`processId`,`createdOn`,`createdBy`,`updatedOn`,`updatedBy`) VALUES (71,363,10,8,'Application was working as per expectation\nAction name, form title and section name should be user friendly\nUse abbrevation for naming convention instead of full name e.g Krishna_Employee CDT Should have been KN_Employee\nUse employeeId instead of id in employee cdt . same for other cdt\nUse seperator in table name words\nUse column defination JPA annoation for all the fields in CDT.\nNo data managment setting configured in process model\nNo Alert setting configured in process model\nNo Security configured in process model\nProcess variable naming should be consistent\nprovide code documentation in process model and SAIL interface itself wherever required',NULL,'2017-09-19 12:46:54',7,'',NULL,'','2017-09-19 12:46:54','ajinkyab');
